import React from 'react';
import './App.css';

class App extends React.Component{
  render() {
    return (
      <div class="centered">
      <div class="quote-wrap">
        <div id="quote-box">
          <blockquote class="blockquote text-right">
            <i class="fas fa-quote-right"></i><p class="mb-0" id="text">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.</p>
            <footer class="blockquote-footer">Someone famous in <cite title="Source Title" id="author">Source Title</cite></footer>
          </blockquote>
        </div>
        <div class="buttons">
          <a class="btn btn-info" id="tweet-quote" title="Tweet this quote!" target="_blank">
            <i class="fa fa-twitter"></i>
          </a>
          <a class="btn btn-info" id="tumblr-quote" title="Post this quote on tumblr!" target="_blank">
            <i class="fa fa-tumblr"></i>
          </a>
          <button type="button" class="btn btn-info" id="new-quote">New quote</button>
        </div>
      </div>
    </div>
    );
  }
}

export default App;
